      $.Util.cookie.set($.Conf.CookieKeys.CUST_PHONE, this.member.phoneNo, 100);

      $.Req.service($.SvName.CARD_PAY_ORDER_CREATE, args, ret => {
        if (!this.enableFreeCodeBuy) {
          if (ret && ret.paySign) {
            this.callWxPay(ret);
          } else {
            $.Dlg.error('');
          }
        } else {
          this.navToMemberSys();
        }
      }, true);
