      let shareDesc = this.card.intro ? this.card.intro.shorten(30) : '';
      let path = "shop-card-sale/{0}".format(this.cardId);
      let shareLink = $.Util.getPageUrl(path);
      wx.ready(() => {
        wx.onMenuShareTimeline({
          title: shareTitle,
          link: shareLink,
          imgUrl: imgUrl,
          success: () => {},
          cancel: () => {
            //toddo
          }
        });

        wx.onMenuShareAppMessage({
          title: shareTitle,
          desc: shareDesc,
          link: shareLink,
          imgUrl: imgUrl,
          success: () => {},
          cancel: () => {
            // 
          }
        });
      });
